var a = '';
var b = '';

var multi = function (a, b) {
    var toNum = function (str) {
        if (!str) return [0];
        var n = [];
        for (let i = 0; i < str.length; i++) n.push(parseInt(str[i]));
        return n;
    };
    var addOne = function (r, idx, n) {
        r[idx] = (r[idx] || 0) + n;
        if (r[idx] > 9) {
            addOne(r, idx + 1, Math.floor(r[idx] * 0.1))
            r[idx] = r[idx] % 10;
        }
    };
    var n1 = toNum(a);
    var n2 = toNum(b);
    var result = [0];

    for (let i = 0; i < n2.length; i++) {
        let n = n2[i];
        for (let j = 0; j < n1.length; j++) {
            let one = n1[j] * n;
            addOne(result, i + j, one)
        }
    }
    while (result.length > 1 && result[result.length - 1] < 1) result.length--;
    return result.reverse().join('')
}
console.time('a');
for (var i = 0; i < 1; i++) {
    var result = multi(a, b);
}
console.timeEnd('a');
console.log(a + '*' + b + '=');
console.log(result);
